// main.js
import Vue from 'vue';
import App from './App.vue';
import router from './router';
import store from './store';

// dotenv 설정
const dotenv = require('dotenv');
dotenv.config({ path: '../.env' });

new Vue({
  router,
  store,
  render: h => h(App)
}).$mount('#app');
